export default function Chat1() {
  const [msg, setMsg] = useState("");
  return (
    <div>
      <div>
        <form>
          <input
            type="text"
            placeholder="Message here..."
            onChange={(e) => setMsg(e.target.vlaue)}
            value={msg}
          ></input>
          <button>Send</button>
        </form>
      </div>
    </div>
  );
}
